import React from 'react';

const AddressTab = ({ form, setForm }) => {
  const update = (field, value) => {
    setForm((prev) => ({ ...prev, [field]: value }));
  };

  return (
    <div className="grid gap-4">
      {/* No. Pelanggan dan Non-Aktif */}
      <div className="flex items-center gap-4">
        <div className="w-full">
          <label className="block text-sm font-medium">No. Pelanggan</label>
          <input
            type="text"
            value={form.customer_number}
            onChange={(e) => update('customer_number', e.target.value)}
            className="w-full border px-3 py-2 rounded"
          />
        </div>
        <div className="flex items-center mt-6">
          <input
            type="checkbox"
            checked={!form.is_active}
            onChange={() => update('is_active', !form.is_active)}
            className="mr-2"
          />
          <span>Non-Aktif</span>
        </div>
      </div>

      {/* Nama */}
      <div>
        <label className="block text-sm font-medium">Nama</label>
        <input
          type="text"
          value={form.name}
          onChange={(e) => update('name', e.target.value)}
          className="w-full border px-3 py-2 rounded"
        />
      </div>

      {/* Alamat */}
      <div>
        <label className="block text-sm font-medium">Alamat</label>
        <input
          type="text"
          value={form.address}
          onChange={(e) => update('address', e.target.value)}
          className="w-full border px-3 py-2 rounded"
        />
      </div>

      {/* Kota / Provinsi / Kode Pos */}
      <div className="grid grid-cols-3 gap-4">
        <div>
          <label className="block text-sm font-medium">Kota</label>
          <input
            type="text"
            value={form.city}
            onChange={(e) => update('city', e.target.value)}
            className="w-full border px-3 py-2 rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium">Provinsi</label>
          <input
            type="text"
            value={form.province}
            onChange={(e) => update('province', e.target.value)}
            className="w-full border px-3 py-2 rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium">Kode Pos</label>
          <input
            type="text"
            value={form.postal_code}
            onChange={(e) => update('postal_code', e.target.value)}
            className="w-full border px-3 py-2 rounded"
          />
        </div>
      </div>

      {/* Negara */}
      <div>
        <label className="block text-sm font-medium">Negara</label>
        <input
          type="text"
          value={form.country}
          onChange={(e) => update('country', e.target.value)}
          className="w-full border px-3 py-2 rounded"
        />
      </div>

      {/* Telepon dan Faksimili */}
      <div className="grid grid-cols-2 gap-4">
        <div>
          <label className="block text-sm font-medium">Telepon</label>
          <input
            type="text"
            value={form.phone}
            onChange={(e) => update('phone', e.target.value)}
            className="w-full border px-3 py-2 rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium">Faksimili</label>
          <input
            type="text"
            value={form.fax}
            onChange={(e) => update('fax', e.target.value)}
            className="w-full border px-3 py-2 rounded"
          />
        </div>
      </div>

      {/* Kontak */}
      <div>
        <label className="block text-sm font-medium">Kontak</label>
        <input
          type="text"
          value={form.contact_person}
          onChange={(e) => update('contact_person', e.target.value)}
          className="w-full border px-3 py-2 rounded"
        />
      </div>

      {/* E-Mail */}
      <div>
        <label className="block text-sm font-medium">E-Mail</label>
        <input
          type="email"
          value={form.email}
          onChange={(e) => update('email', e.target.value)}
          className="w-full border px-3 py-2 rounded"
        />
      </div>

      {/* Halaman Web */}
      <div>
        <label className="block text-sm font-medium">Halaman Web</label>
        <input
          type="text"
          value={form.website}
          onChange={(e) => update('website', e.target.value)}
          className="w-full border px-3 py-2 rounded"
        />
      </div>
    </div>
  );
};

export default AddressTab;
